import React from "react";
import "./Login.css";
const Login = () => {
  return (
    <div className="Login__wrapper">
      <form className="Login__wrapper-form">
        {/* <input name="username" type="text" placeholder="Username" />
        <input type="password" placeholder="password" /> */}
        <button>Login</button>
      </form>
    </div>
  );
};

export default Login;
